    return ( 
        <form className="mt-4">
            <label>
                <span>First Name:</span>
                <input type="text" placeholder="First Name" className="border border-black px-2 py-1 mb-3" />
            </label>
            <label>
                <span>Last Name:</span>
                <input type="text" placeholder="Last Name" className="border border-black px-2 py-1 mb-3" />
            </label>
            <button className="px-2 py-2 border border-black">Submit</button>
        </form>
    );
}

export default Form;
